import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>안녕하세요</h1>
      {/* 컴포넌트 사용 */}
      <Subject></Subject>
      <hr/>
      <NAV></NAV>
      <hr/>
      <Content></Content>
    </div>
  );
}

function NAV(){
  return(
    <nav>
      <ul>
        <li><a href="1.html">HTML</a></li>
        <li><a href="2.html">CSS</a></li>
        <li><a href="3.html">JavaScript</a></li>
      </ul>
    </nav>
  );
}

function Content(){
  return (
    <article>
      <h2>HTML</h2>
      HTML은 하이퍼텍스트 마이크업 언어입니다.
    </article>
  );
}

export default App;
